import React from 'react';
import './errorMessage.css';

const ErrorMessage = () => {
  return (
    <>
      <img src={process.env.PUBLIC_URL + '/img/error.jpeg'} alt="error"/>
      <span className="text-center">Something goes wrong</span>
    </>
  )
};

export default ErrorMessage;
